    'swing': cubic-bezier(0.25, 0.8, 0.5, 1)
  ),
  $transition
);
$primary-transition: 0.3s map-get($transition, 'swing') !default;
$secondary-transition: 0.2s map-get($transition, 'ease-in-out') !default;

